#include<iostream>
#include<vector>
using namespace std;
class Solution {
    int m, n;
    int minimum;
public:
    int updateMatrixUtil(vector<vector<int>>& matrix, int x, int y, int count)
    {
        if (x < 0 || y < 0 || x > m - 1 || y > n - 1 || matrix[x][y] == INT_MIN || count > this->minimum)
        {
            return INT_MAX;
        }
        if (matrix[x][y] > 1)
        {
            return matrix[x][y] + count;
        }
        if (matrix[x][y] == 0)
        {
            return count;
        }
        int temp = matrix[x][y];

        if (matrix[x][y] != INT_MIN)
        {
            matrix[x][y] = INT_MIN;
            int north = updateMatrixUtil(matrix, x - 1, y, count + 1);
            int south = updateMatrixUtil(matrix, x + 1, y, count + 1);
            int east = updateMatrixUtil(matrix, x, y + 1, count + 1);
            int west = updateMatrixUtil(matrix, x, y - 1, count + 1);
            matrix[x][y] = temp;
            int mini = min(min(north, south), min(east, west));
            if (this->minimum > mini)
                this->minimum = mini;
            return mini;
        }

        return INT_MAX;
    }
    bool HasZeroNeighbor(int i, int j, vector<vector<int>>& matrix) {
        if (i - 1 >= 0 && matrix[i - 1][j] == 0)
            return true;
        if (i + 1 < matrix.size() && matrix[i + 1][j] == 0)
            return true;
        if (j - 1 >= 0 && matrix[i][j - 1] == 0)
            return true;
        if (j + 1 < matrix[0].size() && matrix[i][j + 1] == 0)
            return true;

        return false;
    }
    vector<vector<int>> updateMatrix(vector<vector<int>>& matrix)
    {
        m = matrix.size();
        n = matrix[0].size();

        for (int i = 0; i < m; i++)
        {
            for (int j = 0; j < n; j++)
            {
                if(matrix[i][j] == 1 && HasZeroNeighbor(i,j,matrix)) // no need to do dfs if it has neighbouring zero
                {
                    continue;
                }
                if (matrix[i][j] == 1)
                {
                    minimum = INT_MAX;
                    int minimumDistTOZero = updateMatrixUtil(matrix, i, j, 0);
                    matrix[i][j] = (minimumDistTOZero == INT_MAX ? 0 : minimumDistTOZero);
                }
            }
        }
        return matrix;
    }
};
